import React from 'react';
import { Cell } from './cell/Cell.tsx';
import './cell/cell.css';
import './board.css';

export const Board = () => {
  const array: number[] = [];
  for (let num = 1; num <= 64; num++) {
    array.push(num);
  }
  // console.log(array)

  return (
    <>
      <div className="container">
        {array.map((num) => (
          <Cell id={`cell_${num}`} />
        ))}
      </div>
    </>
  );
};
export default Board;
